import React, { useEffect, useState } from "react";
import {
  fetchProducts,
  fetchCart,
  addToCart,
  removeCartItem,
  updateCartItem,
  checkout,
} from "./api";
import ProductList from "./components/ProductList";
import CartView from "./components/CartView";
import CheckoutModal from "./components/CheckoutModal";
import "./styles.css";

function App() {
  const [products, setProducts] = useState([]);
  const [cart, setCart] = useState({ items: [], total: 0 });
  const [showCheckout, setShowCheckout] = useState(false);
  const [receipt, setReceipt] = useState(null);

  // ✅ Load products and cart once
  const loadProducts = async () => {
    try {
      const res = await fetchProducts();
      setProducts(res);
    } catch (err) {
      console.error("Error loading products:", err);
    }
  };

  const loadCart = async () => {
    try {
      const res = await fetchCart();
      // ✅ Always ensure items & total are valid
      setCart({
        items: Array.isArray(res.items) ? res.items : [],
        total: res.total || 0,
      });
    } catch (err) {
      console.error("Error loading cart:", err);
    }
  };

  useEffect(() => {
    loadProducts();
    loadCart();
  }, []);

  // ✅ Cart handlers
  const handleAdd = async (productId) => {
    try {
      await addToCart(productId, 1);
      await loadCart();
    } catch (err) {
      console.error("Error adding item:", err);
    }
  };

  const handleRemove = async (cartItemId) => {
    try {
      await removeCartItem(cartItemId);
      await loadCart();
    } catch (err) {
      console.error("Error removing item:", err);
    }
  };

  const handleQty = async (cartItemId, qty) => {
    try {
      if (qty < 1) return;
      await updateCartItem(cartItemId, qty);
      await loadCart();
    } catch (err) {
      console.error("Error updating qty:", err);
    }
  };

  const handleCheckout = async (name, email) => {
    try {
      const payload = {
        cartItems: cart.items.map((i) => ({
          productId: i.productId,
          qty: i.qty,
        })),
        name,
        email,
      };
      const res = await checkout(payload);
      setReceipt(res.receipt);
      setShowCheckout(false);
      await loadCart();
    } catch (err) {
      console.error("Error during checkout:", err);
    }
  };

  // ✅ Helper to calculate total item count
  const totalItems = cart.items.reduce((sum, item) => sum + item.qty, 0);

  return (
    <div className="app">
      <header className="header">
        <h1>🛒 Vibe — Mock Shop</h1>
        <div className="cart-summary">
          Items: {totalItems} • Total: ₹{Math.round(cart.total)}
        </div>
      </header>

      <main className="main">
        <ProductList products={products} onAdd={handleAdd} />

        <CartView
          items={cart.items}
          total={cart.total}
          onRemove={handleRemove}
          onQty={handleQty}
          onCheckout={() => setShowCheckout(true)}
        />
      </main>

      {showCheckout && (
        <CheckoutModal
          onCancel={() => setShowCheckout(false)}
          onSubmit={handleCheckout}
        />
      )}

      {receipt && (
        <div className="receipt-modal">
          <div className="receipt-card">
            <h3>Receipt</h3>
            <div>Receipt ID: {receipt.id}</div>
            <div>Time: {new Date(receipt.timestamp).toLocaleString()}</div>
            <div>Name: {receipt.name}</div>
            <ul>
              {receipt.items.map((it) => (
                <li key={it.productId}>
                  {it.name} x{it.qty} — ₹{Math.round(it.lineTotal)}
                </li>
              ))}
            </ul>
            <strong>Total: ₹{Math.round(receipt.total)}</strong>
            <button onClick={() => setReceipt(null)}>Close</button>
          </div>
        </div>
      )}

      <footer className="footer">
        Built for Vibe Commerce — mock checkout only.
      </footer>
    </div>
  );
}

export default App;
